import React from 'react'
import "../Component/Header/Header.scss"
import playLogo from '../Asset/prep-tube-logo.png';

function Header() {
    return (
        <div className="header">
            <img className="header__logo" src={playLogo} alt='logo'/>
        </div>
    )
}

export default Header
